import React from 'react';
import styled from '@emotion/styled';
import { Col, Container, Row } from 'react-bootstrap';

const ContainerStyle = styled.div({
  justifyContent: 'center',
  alignItems: 'center',
  textAlign: 'center'
})

export default function App() {
  return (

    <ContainerStyle>
      <Container>
        <Row>
          <Col>1 of 4</Col>
          <Col>2 of 4</Col>
          <Col>3 of 4</Col>
          <Col>4 of 4</Col>
        </Row>
      </Container>
    </ContainerStyle>
  );
};
